INSERT INTO `` (`Word`,`Meaning`) VALUES ('a','a (a\') m.dh Xarafka koowaad ee xuruufta af soomaaliga, ahna shaqal gaaban.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aa\'','aa\' f.g1 (-\'ay, -\'day) 1. Cid ama wax garaacid, u cagajuglayn. 2. Dagaallamid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aa\'id','aa\'id m.f.dh eeg aa\'.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabayeelid','Aabayeelid m.f.dh eeg aabayeel². ld aabayeel¹ (2), aabeyeelid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabayeel²','Aabayeel² f.mg1 (-yeelay, -yeshay) U a.: qaddarin ama tixgelin cid siin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabayeel¹','Aabayeel¹ m.l 1. A. ah: qaddarinta ama tixgelinta cid la siiyo. 2. ld aabayeelid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabayn','Aabayn m.f.dh eeg aabee.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabbannimo','Aabbannimo m.dh Aabbe ahaansho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabbayaal','Aabbayaal m.l/dh 1. eeg aabbe. 2. Awooweyaashii hore. ld aabbeyaal.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabbe','Aabbe m.l (-bayaal, m.l/m.dh) 1. Nin ubad dhalay. 2. (u.j) Aabbow!; wiilkaygiyow! ld aabbo.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabbo','Aabbo u.j ld aabbe.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aabburan²','aabburan² f.mg4 (-rnaa, -rnayd) Dhiil, haan iwm wax la aabburay ahaansho. Tus. “Weelku waa aabburanyahay”.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aabburan¹','aabburan¹ f.mg1 (-rmay., -rantay, -rmi) Dhiil, haan iwm wax la aabburay noqosho. Tus. “Weelku waa aabburmay”.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aabburid','aabburid m.f.dh eeg aabbur².');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aabburmid','aabburmid m.f.dh eeg aabburan¹.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aabburnaan','aabburnaan m.f.dh eeg aabburan². ld aabburnaansho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aabburnaansho','aabburnaansho m.l/dh ld aabburnaan.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aabbur²','aabbur² f.g1 (-ray, -rtay) Dhiil, haan iwm weel yar oo wax lagu shuban karo afka kaga xirid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aabbur¹','aabbur¹ m.l (-rro, m.dh) Weel yar, wax lagu shuban karo, oo dhiilaha, haamaha iwm afka lagaga xiro.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabee','Aabee f.g2 (-beeyay, -beysay) 1. Cid qaddarin ama tixgelin siin. 2. Weel asal iyo xaydh marin, si uusan biyaha, caanaha iwm u habin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabeyeelid','Aabeyeelid m.f.dh ld aabayeelid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabi','Aabi m.l Gardarro isla weyni iyo kibir ku jiro oo cid lagula muujiyo.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aabiweyrax','aabiweyrax m.l Sabab la\'aan cid dagaal ku qaadid, weyrax kulul.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabo','Aabo m.l Dareen naxariis, rabitaan iyo xurmayn leh oo qof qof kale u hayo.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabonimo','Aabonimo m.dh (siyaa.) Mowqifka dawlad, ama mujtamac kale ku muujinayaan in ay go\'aan kasta u sameeyaan dadka ay mas\'uulka ka yihiin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabyoo','Aabyoo f.mg3 (-ooday, -ootay) Ku aa.: cid xumaan aanay mutaysan kula kicid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aabyood','Aabyood m.f.l eeg aabyoo.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Aad','Aad mu.dhm.y Magacuyaal tilmaama qofka labaad ee kelida ah (lala hadlaha ama wax loo qoraha). “Ninka aad la hadashay waa walaalkay”. ld aa², aydin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadaab','aadaab m.dh 1. Anshax iyo dhaqan wanaagsan oo cidi leedahay. 2. Anshax iyo dhaqan ay cidi leedahay.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadaamid','aadaamid m.f.dh eeg aadaan². ld aadaan¹, aaddamid, aaddaan¹, eedaamid, eedaan¹.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadaan²','aadaan² f.mg1 (-aamay, -aantay) 1. Cod dheer ugu yeerid muslimiinta waqtiyada salaadda. 2. Kor u qaylin neef riyo ah xanuun dartiis. ld aaddan², eedaan².');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadaan¹','aadaan¹ m.l 1. Ogeysiin cod dheer leh oo mu\'addinku ugu yeero muslimiinta waqtiyada salaadda. 2. Ci\' dheer oo neef riyo ahi uu sameeyo marka uu xanuunsado. ld aadaamid, aaddan¹, eedaan¹.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadami','aadami m.l.u 1. Dadka Eebahay dunida guudkeeda ku abuuray oo dhan. 2. Aadami ahaan. ld aadane, aadmi.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadaminnimo²','aadaminnimo² m.dh 1. (fals.) Isku taxluujin ku xiran danaha aadamiga, anshaxiisa iyo barashadiisa. 2. (fals.) Dhaqanka qorista (qarnigii 14aad ilaa iyo kii 16aad ee ku saleysan barashada Giriigga iyo Roomaaniyiintii hore).');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadaminnimo¹','aadaminnimo¹ m.dh Aadami ahaansho. ld aadminnimo.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadane','aadane m.l ld aadami.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aaddamid','aaddamid m.dh ld aadaamid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aaddan²','aaddan² f.mg1 (-damay, -dantay) ld aadaan².');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aaddan³','aaddan³ f.g/mg4 (-naa, -nayd) 1. (f.g) Is aa.: laba nafley wax da\'da ama xoogga iska le\'eg ahaansho. 2. (f.mg) Ku aa.: wax, wax kale ku beegan ahaansho. Tus. “Guriga Cali wuxuu ku aaddanyahay Baar Ubax”. 3. (f.mg) Ku aa.: wax, wax kale muuqaalkooda isku gudbay ahaansho. 4. (f.mg) Ku soo aa.: wax la filayo in uu meel yimaaddo ama ku dhaco waqti go\'an ahaansho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aaddan¹','aaddan¹ m.l ld aadaan¹.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aaddin','aaddin m.f.dh eeg aaddi. ld aadin, aadsiin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadeer','aadeer m.dh ld adeeryo.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadi','aadi f.g2 ld aaddi.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadid','aadid m.f.dh eeg ąad³; ld ąad¹.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadimo','aadimo m.l 1. (fiis.) Cabbir xariiqeedka laga qaaday walax adke ah sida dhererka (l), ballaca (b) ama joogga (h). 2. (fiis.)“Addimaha Xaddiyada Fisikaad” waa habka xaddiyada fisikaad looga soo dhirindhiriyo xaddi saleedyada oo la saaro jibbaaro habboon.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadin','aadin m.dh ld aaddin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadiraac','aadiraac m.l Dhicinta uu neef markaas rimay dhiciyo; qubeys.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadmi','aadmi m.l ld aadami.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadminnimo','aadminnimo m.dh ld aadaminnimo¹.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadsii','aadsii f.g2 (-iiyay, -iisay) ld aaddin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadsiin','aadsiin m.dh ld aaddin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aadyar','aadyar m.dh.fk ld aayar.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Ąad²','Ąad² m.dh.fk (-dyo, m.l) 1. Isku beegnaanta laba meelood ama shay. 2. Badan, si daran. 3. A. yar: ld aayar.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Ąad³','Ąad³ f.g/mg1 (-day, -dday) 1. (f.g) Meel u socdaalid ama u kicid. 2. (f.mg) Ku a.: wax wax kale u dhigmid. 3. (f.mg) Ku ąa.: cunto cabid iwm cid ku filnaan. 4. (f.mg) Ku ąa.: wax muuqaalkooda wax kale isku gudbid. 5. (f.mg) Ku ąa.: meel aadisteeda wax u adeegsasho. Tus. “Cali baabuur buu Kismaayo ku aaday”.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('Ąad¹','Ąad¹ m.l (-dyo, m.dh) 1. Isku ąa. cayaar: isku beegnaan cayaar. 2. ld aadid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aaf','aaf m.dh.u Meel la deggenyahay ama ceel agagaarkood.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aafayn','aafayn m.dh eeg aafee. ld aafeyn.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aafee','aafee f.g2 (-feeyay, -feysay) Cid aafo gaarsiin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aafeysan','aafeysan f.mg4 (-snaa, -snayd) Wax aafo haleeshay ahaansho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aafeysnaan','aafeysnaan m.f.dh eeg aafeysan. ld aafeysnaansho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aafeysnaansho','aafeysnaansho m.l/dh ld aafeysnaan.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aafo','aafo m.dh (-ooyin, m.l) Dhibaato weyn oo abaar, cudur ama colaadi ay keentay oo guud ahaan u saameysa nafley badan; dhibaato aad u weyn.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aafoobid','aafoobid m.f.dh eeg aafow.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aafow','aafow f.mg1 (-oobay, -owday; -oobi) Wax aafeysan noqosho (nafley badan).');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aag','aag m.l.u Dhul ballaaran oo meel la yaqaano ku fadhiyo. Tus. “Aagga Ceelbuur waxaa laga helaa dhagax jilicsan oo burjikooyinka laga qoro”.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aagaan²','aagaan² m.dh (-aamo, m.l) Haan yar oo biyaha ama caanaha lagu shubto.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aagaan¹','aagaan¹ m.l (-nno, m.l/dh) Weel yar oo wax lagu shuban karo oo haamaha lagu aabburo.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aagga-qabow','aagga-qabow m.l (-gag-qabow, m.l) (jool.) Soohdinta dhulka dushiisa ee kala soocda hawo qabow iyo hawo diiran. Hawada qabow ayaa hoos ka cadaadisa tan diirran.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aah','aah e.d Cod yar oo qof xanuun hayo ka soo baxa. ld ah².');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aaho','aaho m.dh (-ooyin, m.l) Dhiibato weyn oo abaar ama cudur ay keenaan oo guud ahaan saameya naflay badan.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aajur','aajur m.l.u Jaajuur yaryar oo ka samaysan dhoobo guduudan oo wax lagu dhiso.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aakhir','aakhir m.l 1. Kan dambe. 2. Quraanka qaybtiisa damba. ld aakhiritaan.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aakhiritaan','aakhiritaan m.l ld aakhir.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aakhiro','aakhiro m.dh Meesha iyo nolosha dambe ee lagu noolaan doono marka adduunka laga tago.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aakhirutahan','aakhirutahan m.l ld aakhir.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aakib','aakib m.l 1. Ka aa. ah: faa\'iidada laga rajeynayo fal lagu dhaqaaqi doono. Tus. “Samaynta Warshadda Saabuunta waxa ka aa. ah in ay joogsato tii dibadda ka imaneysay oo lacagta adagi ku baxaysay”. 2. Ka aa. ah: mudnaanta uu wax, wax kale ka leeyahay. Tus. “Tiro badan waxaa ka aa. ah tayo”.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aalaa','aalaa fk. Inta badan, marar badan, badanaa. Tus.”Aa. ma yimaado saacadahaan”.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąalad','ąalad m.dh (-do, m.dh) 1. Qalab mashiin leh oo wax lagu qabsan karo. Tus. “Kombiyuutarku waa ąa. cusub oo cilmibaarista fududaysay”. 2. Qalab lagu dagaallamo; hub. 3. Qalabka dumarku ay qaataan ee isku qurxiyaan mid ka mid ah.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąalad-kabniin','ąalad-kabniin m.dh (-do-kabniin, m.l)(daaw.) Aalad adag oo lagu kabo addimada ama meel kale oo jirka ka mid ah marka ay jabaan ama kala baxaan. Waxay ka sameysantahay balaastig ama faashad lagu qooyey wax loo yaqaan “plaster of Paris” waxaana lagu dhejiyaa meesha jaban si dhaqdhaqaaqa looga celiyo lafaha la isu keenay.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąaladee','ąaladee f.g2 (-deeyay, -deysay) 1. Wax qalabeyn. 2. Wax qurxin. 3. Ciidan hubayn. 4. Cunto si ay caraf iyo dhadhan u yeelato geedo ku darid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąaladeyn','ąaladeyn m.f.dh eeg ąaladee.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąaladeysan','ąaladeysan f.mg4 (-snaa, -snayd) 1. Wax la qalabeeyay ahaansho. 2. Wax la qurxiyay ahaansho. 3. Wax la hubeeyay ahaansho (ciidan).');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąaladeysnaan','ąaladeysnaan m.f.dh eeg ąaladeysan. ld ąaladeysnaansho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąaladeysnaansho','ąaladeysnaansho m.l/dh ld ąaladeysnaan.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aale','aale m.l Geed lugtool ahaan u baxa, sida qasabka, galleyda, maseggada, qaysaraanta iwm.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aalkol','aalkol m.l Dareere aan midab lahayn oo dabka qabsan og, boogahana lagu dhaqo. ld aalkolo.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aalkolo','aalkolo m.dh ld aalkol.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aallid','aallid m.f.dh eeg aal². ld oollid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aalo','aalo m.dh.u Lo\'da inteeda aan weli gaarin da\'dii ay rimi ama wax rimin lahayd. aamanuu m.dh Waqti hore oo aad u fog.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aal¹','aal¹ m.dh.fk Aashay, -aa, -iis iwm: si aan degdeg iyo fudayd toona ku jirin; aayar, tartiib, qunyar. Tus. “Ciise aashiis buu hadlaa”.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aameel','aameel m.l (-llo, m.dh) 1. Weel qori ka samaysan oo aan dabool lahayn oo lo\'da iyo geela lagu maalo; haruub; doobi.2. Wixii waxay arkaan iska raacaan.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamiin','ąamiin m.dh ld ąammiin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamiinsad','ąamiinsad m.l ld ąamiinsasho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamiinsasho','ąamiinsasho m.dh ld ąammiinsasho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamiinsi','ąamiinsi m.l ld ąammiinsasho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamiinso','ąamiinso f.mg3 (-saday, -satay) ld ąammiinso.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąammiin','ąammiin m.dh Erey la yiraahdo marka la duceysto kaddib, oo ujeeddadiisu tahay in Ilaah aqbalo ducada. ld ąamiin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąammiinsad','ąammiinsad m.l ld ąammiinsasho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąammiinsasho','ąammiinsasho m.f.dh eeg ąamminso. ld ąamiinsad, ąamiinsasho, ąamiinsi, ąammiinsad, ąamm.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąammiinso','ąammiinso f.mg3 (-saday, -satay) Aaammiin dhihid. ld ąamiinso.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamminaad','ąamminaad m.dh ld ąamminid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamminbax','ąamminbax f.mg1 (-xay, -xday; -bixi) Ka ąa.: qof, cid aamminkii uu ku qabay lumin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamminbixid','ąamminbixid m.f.dh eeg ąamminbax.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąammindarreysad','ąammindarreysad m.l ld ąammindarreysasho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąammindarreysasho','ąammindarreysasho m.f.dh ld ąammindarreysad, ąammindarreysi.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąammindarreysi','ąammindarreysi m.l ld ąammindarreysasho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąammindarreyso','ąammindarreyso f.mg3 (-stay, -satay) Ka ąa.: cid ka ąamminbixid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąammindarro','ąammindarro m.dh Kalsooni la\'aan.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamminid','ąamminid m.f.dh eeg ąammin².');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamminnimo','ąamminnimo m.dh Ąammin ahaansho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamminsan','ąamminsan f.g4 (-naa, -nayd) 1. Qof, wax cid aammin ku qaba ahaansho. 2. Qof, wax rumaysan jirista Eebbe iyo diimaha ahaansho. Tus. “Diinta Islaamka ayaan aamminsanahay”.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamminsanaan','ąamminsanaan m.f.dh eeg ąamminsan. ld ąamminsanaansho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamminsanaansho','ąamminsanaansho m.l/dh eeg ąamminsanow; ld ąamminsanaan.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamminsanow','ąamminsanow f.g3 (-naaday, -naatay) 1. Qof, wax cid aamminka ku qabo noqosho. 2. Qof, wax rumaysan jiritaanka Eebbe iyo diinta noqosho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamminsii','ąamminsii f.lg2 (-iiyay, -iisay) Qof in uu wax aammino ka oggoleysiin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąamminsiin','ąamminsiin m.f.dh eeg ąamminsii.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąammin²','ąammin² f.g1 (-nay, -ntay) 1. Cid kalsooni ku qabid. 2. Ku ąa.: cid si kalsooni leh wax ugu dhiibasho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ąammin¹','ąammin¹ m.l 1. Aan dhagar iyo laqdabo aqoon; daacad; lillaahi (qof). 2. Nabad ah; aan cabsi lahayn (meel).');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aammusan','aammusan f.mg4 (-snaa, -snayd) Wax aan hadlayn ahaansho; shibban (cid).');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aammusdaran','aammusdaran f.mg4 (-rnaa, -nayd) Wax aan aammusaynin (cid).');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aammusdarnaan','aammusdarnaan m.f.dh eeg aammusdaran. ld aammusdarnaansho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aammusdarnaansho','aammusdarnaansho m.l/dh ld aammusdarnaan.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aammusi','aammusi f.g2 (-iyay, -isay) Hadal, qaylo ama oohin cid ka celin. Tus. “Carruurta ka aammusi qofka jirran”.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aammusid','aammusid m.f.dh eeg aammus². ld aammus¹.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aammusin','aammusin m.f.dh eeg aammusi. ld aammusis.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aammusis','aammusis m.l ld aammusin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aammusnaan','aammusnaan m.f.dh eeg aammusan. ld aammusnaansho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aammusnaansho','aammusnaansho m.l/dh ld aammusnaan.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aammus²','aammus² f.mg1 (-say, -stay) 1. Hadal joojin. 2. Wax sheegiddiisa ka gaabsasho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aammus¹','aammus¹ m.l 1. Hadal la\'aan. 2. Shib. 3. ld aammusid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aanayn','aanayn m.f.dh eeg aanee. aanaysad m.l ld aanaysasho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aanaysasho','aanaysasho m.f.dh eeg aanayso. ld aanaysad, aanaysi.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aanaysi','aanaysi m.l 1. Godob u raadsi. 2. Xigtaysi. ld aanaysasho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aanayso','aanayso f.g/mg3 (-stay, -satay) 1. Godob u raadsasho. 2. Qaraabannimo ama saaxibnimo awgeed cid u xigsasho (qof).');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aanee','aanee f.g/mg2 (-neeyay, -naysay) 1. (f.g) U aa.: cid, cid kale oo dakano ka gashay ka gudid. 2. (f.mg) U aa.: wax dhacay cid ku tuhmid. Tus. “Waxyeelada baabuurka gaartay waxaa loo aaneynayaa taxaddar la\'aanta shufeerka”.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aannu','aannu mu.dhm.y Magacuyaal tilmaamaya qofka koowaad ee wadarta ah (marka laga reebo lala hadlaha). Tus. “Xafiiska aannu aragnay waa xafiiskaada cusub”. ld aan1.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aano','aano m.dh Dhibaato hore oo ciddii loo geystay aanay illaawin; godob; utun; dakano.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aan²','aan² qr.diid Qurub tilmaamaya in weertu tahay weer diidmo, weer xor ah ama midaan ahayn tu ay tahayba. Tus. “Miyaan fadhigii la qaban?”, “Yaan lacag la siin!”, “Wiilka aan imaanini waa Cali”. ld an.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aan¹','aan¹ mu.dhm.y 1. Magacuyaal tilmaama qofka koowaad ee kelida ah (hadlaha ama wax qoraha). Tus. “Meel aan ku nasto ayaan doonayaa” 2. ld aannu.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aaraa\'','aaraa\' m.dh.w eeg ra\'yi.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aarad','aarad m.dh (-do, m.l) Liid maro ah oo qurxin awgeed loogu tolo dacallada maryaha la xirto iyo daahyada.');
