INSERT INTO `` (`Word`,`Meaning`) VALUES ('abyane-huban','abyane-huban m.l (-nayaal ..., m.l/dh) (xis.) Jawaabta abyanka fansaar kasta ee hal doorsoome f(x), ee u dhexeeya laba qiime oo magacaaban ee x: x, iyo x2.');
