INSERT INTO `` (`Word`,`Meaning`) VALUES ('abyin','abyin m.l (-nno, m.dh) (xis.) Habka lagu raadiyo abyanku huban ama aan hubanayn. Abyintu waa weydaarka xigsinaynta. Tusaale ahaan, haddii f(x) ay tahay fansaarka ee x oo marka la diiro ku siisa f(x), markaa F(x) waxa la yiraahdaa abyin ama lidka diirane ee f(x).');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('abyin-jeexeed','abyin-jeexeed m.l (-dyo, m.dh) (xis.) Hab lagu sammeeyo abyinaynta taranka laba fansaar iyada oo la adeegsanaayo jidka: u (dv/dx)dx = uv - v (du)dx, oo loo adeegsan karo qiimeynta abyinka ee taran.');
