INSERT INTO `` (`Word`,`Meaning`) VALUES ('adeeg¹','adeeg¹ m.l 1. Hadal aan qornayn oo cid loo dhiibo si ay cid kale u gaarsiiso, farriin. 2. Shaqa hoosaad laga qabto guryaha iyo xafiisyada oo aan u baahnayn xirfad gaar ah. Tus. “Adeeggii buu diidey”. 3. Waxyaabaha daruuriga ah ee qoys maalin suuqa uga baahanyahay.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('adeer','adeer m.l (-rro, m.dh) 1. Nin waxa uu u yahay ilmaha walaalkii dhalay. 2. Hab xurmo leh oo qof da\'weyn loogu yeero. 3. (u.j) adeerow! 4. (u.j) wiilka aan adeerka u ahayow!; gabadha aan adeerka u ahayey!');
