INSERT INTO `` (`Word`,`Meaning`) VALUES ('adke','adke m.l (-kayaal, m.l/dh) 1. (fiis.) Maatarka saddexdiisa qaybood middood oo leh mug iyo qaab go\'an, iskana caabida xoogagga qaabkeeda beddelaya. 2. (xis.) Shaxan joomaterikaad oo saddex aaddimood leh. 3. (xis.) A. lix salaxaale: shaxan adke ah oo leh lix weji oo barbarooleyaal ah. 4. (xis.) A. uumiyoobe: wejigeddoonka adkuhu ku noqdo neef isaga oo aan marka hore dhalaalin.');
