INSERT INTO `` (`Word`,`Meaning`) VALUES ('alfiyoole','alfiyoole m.l (-layaalyo, m.l/dh) (c.nafl.) Kiish yar oo ka samaysan xuub khafiif ah, oo ay ku daboolanyihiin tintaafyo wada shaqaynaya oo ku yaalla dhammaadka faracyaraha hunguriga oo neefsashada sambabadu kadhacdo dushiisa. Sambabku waxa uu leeyahay alfiyoole fara badan. Alfiyoolayaasha ku jira sambabka aadanaha waxa bedkiisa lagu qiyaasay inuu yahay 100 mm.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('algoordan','algoordan m.l (-amo, m.dh) (xis.) Urur qaanuunno ah oo hagaag u qeexan, loona adeegsado furfirista mas\'alad iyada oo la qaadayo tallaabooyin tiradoodu koobantahay.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('alhuumo','alhuumo m.dh Dhibaato weyn; belo.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('alif','alif m.l (-fyo, m.dh) 1. Xarafka ugu horreeya farta Carabiga. 2. Alifba\'. 3. Astaan alifka u eg oo xoolaha lagu sunto. 4. (alfaan, m.dh)Darajo la siiyo sarkaalxigeenka.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('alifaatig','alifaatig m.l (-gyo, m.dh) (kiim.) Iskudhis orgaanig ah oo ah alkeyn, alkiin, ama alkayn iyo faracooda. Iskudhisyada alifaaligga ah badidoodu waxay leeyihiin dhis silsilad furan, hasayeeshe qaarkood, sida saykalohigseyn iyo sukurows, waxay leeyihiin giraamo.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('alifba\'','alifba\' m.dh Xuruuf af lagu qoro oo ka kooban shaqallo iyo Shibbanayaal; alif. ld alif.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('alifka','alifka dhigata. 2. Ciidamada inta alif sidata.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('alifle','alifle m.l (-layaal, m.l/dh) Qof ciidanka qalabka sida ka mid ah oo darajadiisu hal alif tahay.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('alifley','alifley m.dh.u 1. Carruur dugsi ku jirta oo');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aliil','aliil m.l (-lo, m.dh) (baay.) Mid ka mid ah muuqaallada talantaalliga ah ee hiddo side. Noolayaasha badankoodu waxay leeyihiin laba aliil oo midba hiddoside ka yimid (midba waalid ka yimid), kaas oo ku jira koromosoomyo iskumid ah. Hal aliil badanaa waxa uu shiiqiyaa ka kale oo loo yaqaan shiiqsane, kaas oo ay ka baxaan astaamaha u gaarka ah noolahaas.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aliindi','aliindi m.l Dhar gacanta lagu sameeyo, adag, midabbo iyo noocyo badan leh, oo Soomaaliya lagu sameeyo. ld iliindi.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aljebra','aljebra m.l (xis.) Laan ka mid ah xisaabta oo lagu barto habdhisyada tirooyinka iyo astamahooda guud ahaan. Waxa la adeegsadaa xuruufo ama summado u taagan xaddiyada, iyo astooyin u taagan iskuxiridda xaddiyada ama tirooyinka.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('alji','alji m.l.u (-iyo, m.dh) (baay.) Qayb badan oo ka duwan dhirta yar yar, hase yeeshee cagaariye leh (footoosintasis) cuntadiisa ku samaysan kara, kuna nool sabo biyood iyo dhulka saxansaxada leh. Geedkani waxa uu noqon karaa hal unugley ama unugyo badane. Isaga oo yeelan kara qaababkan: miiqaq, wareegsan ama saxan u eg. Aljiga hadda looma aqoonsana koox abla-ablayneed, inkastaoo mararka qaarkood la raaciyo noolayaasha hoose ee boqortooyada borotista. Inta badan haddaba, kooxaha boqortooyadan waxa loo aqoonsanyahay qaybaha abla-ablayneed.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('alkaali','alkaali m.l (-iyo, m.dh) (kiim.) Beys xooggan oo biyaha ku milma. Ereygani wuxuu tilmaamayaa haydarogsaydhada biraha alkali (ururka I) oo keliya, hasayeeshee sida caamka ah waxaa loo isticmaalaa beys kasta oo milma.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('alkahool','alkahool m.l (-lo, m.dh) (kiim.) Iskudhis orgaanig ah oo ka kooban hal ama in ka badan oo haydaroogsayl (-OH). Alkahoolladu waa haydaroogsi laga soo dhirandhiriyey alkeynnada. Waxay sameeyaan taxane isku mid ah C H n+1. H. Alkahoollada waxa lagu kala sooci karaa dabeecadda kaarboon atamka ay ku dhegsanyihiin.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('alkayn','alkayn m.l (-no, m.dh) (kiim.) Koox ka tirsan haydarokaarboonnada aan dheregsanayn; loona yaqaan sitayliinno. Waxay wadaagaan naanaysta guud ee C H-na waa abyoone.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('alkeyn','alkeyn m.dh (-no, m.dh) (kiim.) Nooc haydarokarboon ah oo leh naaneysta guud ee C H . Alkeynadu waa iskudhisyo baahan.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('alkiin','alkiin m.l (-no, m.dh) (kiim.) Nooc haydarokarboon ah oo leh naaneysta guud ee C H . Alkiinada (oo hore loo oran jiray olifiino) waa iskudhisyo aan dheregsaneyn oo leh dabar lammaan oo kaarboon-kaarboon ah.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('alkohooliisam','alkohooliisam m.l (daaw.) Xaalad bukaansho ka timid u barashada aalkohoolka ee qofka, taas oo haddii si kadis ah looga joojiyo keeni karta calaamado: sida gariir, xasilloonila\'an, halluujineeshinis iyo qalbi jab.');
