INSERT INTO `` (`Word`,`Meaning`) VALUES ('alluumiiniyam','alluumiiniyam m.dh (kiim.) Bir firfircoon oo jilicsan, waana curiyaha labaad ee ururka (III) ee tusaha kalgalka curiyayaasha. Wuxuu leeyahay ratibaadda elektaroonnada ee niyuun iyo saddex elektaroon oo dheeraad ah oo ku jira heertamarka ugu sarreeya. Alluumiiniyantu waxay ku jirtaa macadanno badan; waa curiyaha ugu caansan biraha ku jira oogada dhulka, waana ka saddexaad xagga badnaanta.');
