INSERT INTO `` (`Word`,`Meaning`) VALUES ('arag-dhowaadka','arag-dhowaadka m.l (-rgo ..., m.l) (daaw.) Xaalad arag oo ay fallaaraha ifku ku dhacayaan meel ka horreysa xuubka aragga (reetina); wixii yaal meel ka fog lix mitir si fiican looma arko, isha oo la khasbana laguma sixi karo. Waa in la qaato murayadaha indhaha oo takhtarku u qoray.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('arag-qumin','arag-qumin m.dh (daaw.) Awoodda ishu ay ku qumiso dhererka kulmiska bikaacadeeda, ayna u tusto hummaagyo bayaan ah ee walxo yaala fogaanno kala duwan.');
