INSERT INTO `` (`Word`,`Meaning`) VALUES ('aragti','aragti m.dh (-iyo, m.l) 1. Sida arrin cid ugu muuqato. 2. Awoodda waxgarashada dadka. 3. Arag. Tus. “Nin iyo baadidii aragti baa ka dhexeysa”. 4. Fikrad, mabda\' iwm oo cidi rumaysantahay kuna salaysan xeerar iyo qawaaniin gaar ah.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aragti-haraa','aragti-haraa m.dh (-iyo ..., m.dh) (xis.) Aragtida loo tibaaxo isle\'egta f(x) = (xa)gx+f(a) taas oo micnaheedu yahay haddii tibxaale f(x) ee doorsoome x,loo qaybiyo (xa), oo a ay tahay madoorsoome; tibixda haraaga waxa ay le\'eg tahay qiimaha tibxaalaha marka x = a. Tibxaalaha sare f(1) = 2+3-1-4= 0, sidaa daraadeed (x-1) waa isir.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aragti-isir','aragti-isir m.dh (-iyo ..., m.dh) (xis.) Xaaladda ay (x-a) ku noqonayso isirka tibxaalaha f(x) ee doorsoome x, haddii iyo haddii oo keliya f(a) = 0. Tusale ahaan, haddii f(x) = x +x-6 = 0 f(-3) = 9-3-6= 0; f(2) = 4+2-6 = 0. Sidaa daraadeed isirrada f(x) waa (x-2) iyo (x+3). Aragtida isirka waxa laga soo diiray aragtida haraaga.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aragtida-Darwin','aragtida-Darwin m.dh (-iyaha ..., m.l) (baay.) Aragtida tadawurka ee ahayd isirka sinjiyada oo Charles Darwin soo saaray 1859, taas oo ilaa haddadadka qaarkood rumaysanyahay sinjiyadu inay ka soo jeedaan noocyada abnaqyada hoose, marka loo eego dariiqadda xulashada dabeeciga.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aragtida-kuwaantam','aragtida-kuwaantam m.dh (-iyada ..., m.dh)(fiis.) Aragti ugu horeyntii u soo saaray Maks Blank (1858-1947) oo sharaxaysa kaaha walax madow, wuxuuna soo bandhigay afeef ah in tamarta birlabdanabeedku ku baxdo kuna qaadanto qaybo joogto ahayn oo ku dhufsanayaal abyoon ah. Tusaale ahaan, tamartu waxa ay u baxdaa baakidho yar yar oo isdabajoog ah. Rakaad kasta oo birlabdanabeed waxa la xiriira baakidho yaryar oo tamar ah, ma jirto tamar la helo oo ka yar baakidhadan, kuwaas oo loo yaqaano kuwaantaam ama footoon.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aragtida-Leewis','aragtida-Leewis m.dh (-iyada ..., m.dh)(kiim.) eeg asiidha Lewis.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aragtiinka-asaasiga-ah-ee-aljebra','aragtiinka-asaasiga-ah-ee-aljebra m.l (xis.) Isle\'eq tibxaale kasta oo leh sansaanka a z + a,z + a z ... +a z + a =o, taas oo a , a , a ,... iwm ay yihiin tirooyin murakab ah oo leh ugu yaraan hal xidid oo murakab ah.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aragtiinka-asaasiga-ee-kalkulaska-abynan','aragtiinka-asaasiga-ee-kalkulaska-abynan m.l(xis.) Aragtiin tibaaxaysa xiriirka ka dhexeeya abyan iyo xigsinayn, taas oo ah, haddii abyanka f(x)dx uu jiro, iyo urliba fansaarka f(x) uu jiro f\'(x) = f(x) marka a x b; marka f(x)dx = F(b) - F(a).');
