INSERT INTO `` (`Word`,`Meaning`) VALUES ('aritmatig','aritmatig m.l (xis.) Barashada xirfadaha la xiriira xisaabinta, iyadaoo la adeegsanayo tirooyin iyo xisaabfallo, sida; isugeyn, kalagoyn, iskudhufasho iyo isuqaybin. Waxa kale oo ay la xiriirtaa barashada dhismaha habdhiska tirooyinka, iyo sida tiro sansaankeedu loogu beddelo sansaan kale, sida; jajabyada oo loo beddelo jajab tobanle, boqolley oo loo beddelo jajab.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('arjantam','arjantam m.l (-mmo, m.dh) (kiim.) Bir ka tirsan curiyeyaasha kalaguurka ah oo u jiri kartaa asal ahaan iyo weliba salfaydh (AgS) iyo kolorayd (AgCl) ahaanba. Summaddeedu waa: Ag. Bar dhalaalkeeduna (b.dh.) 960 C. Bar karkeeduna (b.k.) 2180 C. Cufnaan beeggeeduna waa 10.5, tiroborotoon 47, cuf atammeed 107.87.');
