INSERT INTO `` (`Word`,`Meaning`) VALUES ('arǫor','arǫor m.dh Waqtiga u dhexeeya marka waagu dillaaco ilaa marka qorraxdu soo baxdo. ld arooryo.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aroore','aroore m.l (-rayaal, m.l/dh) (baay.) Dhuun dhiig oo dhiigga ku shubta wadnaha.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aroore-holac','aroore-holac m.l (-cyo, m.dh) (daaw.) Halaamacoodka xididdada dhiigga ku cesha (aroore), sida badan waxaa lagu arkaa lugaha wuxuuna ku dhacaa aroore ballaartay oo laalaaban (varicose veins). Arooruhu xanuun badan ayuu yeelanaya waana adkaanaya maqaarka korkiisa ahna waa kululaanayaa waana casaanayaa. Xinjir xirikareysa xididdada ayaa inta badan sameysmata.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aroore-qaade','aroore-qaade m.l (-dayaal, m.l/dh) (daaw.) Aroore kasta oo dhiig ka soo qaada tintaafyo dhiig oo wada shaqeeya oo toos ugu soo gudbiya tintaafyo kale oo wada shaqeeya una yaalla qayb kale oo jidhka ka mid ah, isaga oo aan ku celinayn wadnaha.');
