INSERT INTO `` (`Word`,`Meaning`) VALUES ('artaraboodha','artaraboodha m.l (-ooyin, m.l) (baay.) Faylam ka tirsan xayawaanka laf dhabarla\'da oo ka kooban in ka badan hal milyan oo sinji. Waa faylamka ugu ballaadhan ee boqortooyada xayawaanka. Artaraboodhuhu waxay ku noolyihiin biyaha macaan, badaha iyo dhulalka kala duwan. Astaan ahaan artaraboodhuhu waxay leeyihiin dub sare oo loo yaqaanno toxob, kaas oo dabool adag u ah qalfoof duleedka. Koritaankooduna waxa uu suurtaggal yahay oo keliya xilliga xuub siibashada.');
