INSERT INTO `` (`Word`,`Meaning`) VALUES ('asalmadoorshe','asalmadoorshe m.l (-shayaal, m.l/dh) (xis.) Kutirsane urur oo marka lagu xiro ku tirsane kale ee kasta ee ku jira ururka aan isbeddelin. Asalmadoorshaha waxa uu ku xiranyahay kutirsaneyaasha ururka iyo xisaabfalka la adeegsado. Tusaale ahaan, eber waa asalmadoorshaha isugeynta: 0+3=3+0. Hal waa asalmadoorshaha iskudhufashada: 1x3=3x1.');
