INSERT INTO `` (`Word`,`Meaning`) VALUES ('asii','asii xi. (nax.) 1. Erey lagu xiriiriyo laba weer aan xor ahayn; “oo”. Tus. “Haddaan lacag siiyo asii diido, maxaan sameynayaa?” 2. Erey lagu xiriiriyo laba weer xor ah; “-na”. Tus. “Lagac baan siiyay asuu diiday”.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('asiib','asiib f.g1 (-bay, -btay) 1. Dhibaato weyn cid ku dhicid. “Inkaar baa asiibtay Cali”. 2. Arrin xalkeeda dhabta helid. Tus. “Ardaygii jawaabtii waa asiibay”. ld aseeb.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('asiibid','asiibid m.f.dh eeg asiib. ld aseebid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('asiidh','asiidh m.l (-dyo, m.dh) (kiim.) 1. Nooc iskudhis ah oo leh haydarojiin kuna kalafurma biyaha oona saara ayoonno togan oo haydarojiin ah. 2. Aragtida lowriboronistidh ee asiidhada iyo beysyada (1923), waxay qeexiddaa hore u ballaadhisay, in asiidhu tahay borotoo.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('asiidh-bu\'eed','asiidh-bu\'eed m.dh (-dyo ..., m.dh) (baay.) Silsilad weyn oo dheer oo molikiyuul ah, kana kooban silsilado nukliyootaydho ah, waxa laga helaa noolaha oo dhan. Taas oo qaadda wararka hiddo sidaha.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('asiidh-cabirid','asiidh-cabirid m.dh (kiim.) Saafid-mugeed ama mitimis asiidh-beys halkaas oo milan caadi ah oo asiidh ah lagu daro milan ribnaantisi dahsoontahay oo ah beys tilmaame ku jiro. Alkalicabiridduna waa roganka asiidhcabiridda. Eeg alkalicabirid.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('asiidh-dufaneed','asiidh-dufaneed m.l (-dyo ..., m.dh) (baay.) Iskudhis orgaanig ah oo ka kooban silsilad haydarookaarboon iyo dhammaad ah koox kaarboogsayl.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('asiidh-laagtika','asiidh-laagtika m.dh (-dyo ..., m.dh) (baay.) Asiidh dhanaan oo dhis naanays molikiyuulkeedu yahay CH3CH(OH)COOH, asiidhka laagtig waxay ka timid asiidhka bayruufig, marka muruqyadu firfircoonyihiin ogsajiintuna xaddidantahay. Taasoo si isbada joog ah beerku u saaro una beddelo gulukows. Jimicsiga xoogga badan waxa laga yaabaa in ay ku ururto muruqyada dhexdooda taas oo keenta muruqyo xanuun. Waxa kale oo ay asiidhka laaktig ka qayb qaadataa khamiirinta caanaha, iwm.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('asiidh-ooman','asiidh-ooman m.l (-dyo ..., m.dh) (kiim.) Iskudhisyada la falgala biyaha soona saara asiidh. Tusaale ahaan, karboon laba ogsaydh waxa uu lafalgalaa biyaha waxaana samaysma kaarboonig asiidh: CO2(g) + H2O(aq) = H2CO3(aq).');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('asiidha-yuurig','asiidha-yuurig m.dh (baay.) Maxsuulka burburka buriin ee garaadleyda shimbiraha, xammaaratada berriga iyo cayayaanka. Marka laga reebo garaadleyda, Maxsuulkaas badankiisa waa la qashinsaaraa. Asiidhka yuurig waa ma milme, sidaa darteed, waxa loo saaraa adke ahaan, taas oo dhowrta biyaha qiimaha u leh dhulka oomanaha ah. Asiidhka yuurig markay jidhka ku badato waxay ku ururtaa kala goysyada dhareerka leh taas oo ay ku keento xanuun.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('asiili','asiili m.l 1. ld asali. 2. Dugsiga caruurta yaryar aadaabta iyo farta lagu baro inta aanay waxbarashada rasmiga ah bilaabin.');
