INSERT INTO `` (`Word`,`Meaning`) VALUES ('ATP','ATP m.dh (kiim.) Iskudhis orgaanika ah oo ka kooban adaniin ribows iyo saddex kooxood oo foosfeyt aan orgaanik ahayn. ATP-du waa niyukliyotaydh. Waxaanay mas\'uul ka tahay inay tamarta si ku meel gaadh ah u keydiso intay socoto neefsashada unuggu. Waxay ka samaysantay ADP lagu daray foosfeyt saddexaad taas oo keydisa tamar soona saarta marka looga baahdo dariiqad kale oo dheef samayneed.');
