INSERT INTO `` (`Word`,`Meaning`) VALUES ('aynnu','aynnu mu.dhm.y Magacuyaal tilmaama qofka koowaad ee wadarta ah oo ku jira kuwa lala hadlayo ama wax loo qorayaa; innagu. Tus. “Guriga aynnu aadno”.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aynshaadid','aynshaadid m.f.dh eeg aynshaad².');
