INSERT INTO `` (`Word`,`Meaning`) VALUES ('ayo','ayo e.we 1. Kuma?, kee?, tuma?, tee? 2. Waa a.?: waa kuma?, yaa waaye?');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ayodhiin','ayodhiin m.l (daaw.) Maaddo kiimikaad oo jirku u baahanyahay qaddar yar si loo gaaro koritaan caafimaad qaba. Jirka qof weyn waxa ku jira 30 mg. oo ayodhiin ah,inta badanna rasin ku tahay qanjirka dhiiqa ee taayroodka.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ayoon','ayoon m.dh (-nno, m.dh) (kiim.) Atam ama koox atamyo ah oo lumiyay hal ama in ka badan oo elektaroonno ah si ay u yeeshaan saldanab togan (a. togan), ama helay hal ama in ka badan oo elektaroonno ah si ay u yeeshaan saldanabtaban (a. taban). Weliba eeg aayoonayn.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ayoon-taban','ayoon-taban m.l (-nno ..., m.dh) (kiim.) Ayoon saldanab taban leh, oo sameysma marka atamyada ama molikiyuulada lagu daro elektaroonno. Marka danabsoocidda la sameynaayo, ayoonada taban waxa jiita qotinka togan.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ayoon-togan','ayoon-togan m.l (-nno ..., m.dh) (kiim.) Ayoon saldanab togan oo ka dhashay atammo ama molikuyuullo laga xayuubiyey elektaroonno. Marka danabsoociddu dhacayso, ayoon-toganayaasha waxa jiita qotinka taban.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ayoonisfeer','ayoonisfeer m.l (fiis.) Gibilka saddexaad ee xiga istaratosfeerka fidsan ilaa 1,000 km. Gibilkani, waxa uu leeyahay afar lakab, oo neefaha ku jiraa ay yihiin aysonno. Taasi waxa ay inoo fududeysaa isgaarsiinta iyo baahinta wararka.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ayro','ayro m.dh.u Hal adkaysi badan oo cad iyo caano dheeraad ah leh.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('aysootoonik','aysootoonik m.l (-kyo, m.dh) (baay.) Waxa lagu sharxaa milannada leh cadaadis isku mid ah. Tus. “Milan”, .01m oo sonkor ah iyo milan .01m oo gulukows ahi waa milanno cadaadis isku mid ah leh”.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ay²','ay² m.dh (bot.) Eray badanaa lagu isticmaalo dalalka Ustaraaliya, Niyuusilaand iyo Maraykanka oo lagu isticmaalo gobol ay daboosho jidhi; amase, waxaa lagu isticmaalaa gobol dhiraysan oo aan loo bannayn qodaal. Waxaa kaloo si dabacsan loogu isticmaalaa gobol kasta oo dugag ah oo aan loogu talaggelin qodaal.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ay³','ay³ f.mg1 (aayay, ayday) U a.: wax hore loo sameeyey waqti dambe ka faa\'ideysasho.');
INSERT INTO `` (`Word`,`Meaning`) VALUES ('ay¹','ay¹ m.dh 1. Meel geedo badan leh; hawd. 2. Meel cidla ah oo aan la degganayn.');
